/* Function  structure for function  `checkBalanceExist` */

/*!50003 DROP FUNCTION IF EXISTS `checkBalanceExist` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `checkBalanceExist`(p_user_id INT, p_dec_amount DEC) RETURNS decimal(10,0)
BEGIN
    DECLARE after_balance DECIMAL ;
    UPDATE  user_balance 
    SET
          balance = balance - dec_amount 
    WHERE user_id = p_user_id 
     AND  balance > p_dec_amount ;
    SELECT 
        FOUND_ROWS() INTO @valid ;
    RETURN @valid ;
END */$$
DELIMITER ;

/* Function  structure for function  `getBalance` */

/*!50003 DROP FUNCTION IF EXISTS `getBalance` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getBalance`(p_id_user_id INT, p_tx_type TEXT) RETURNS int(11)
BEGIN
  
    IF(p_tx_type = 'flexiload') 
    THEN 
	SELECT  dec_flexiload  
	INTO 	@current_balance   
	FROM    userbalance 
	WHERE   id = p_id_user_id ;
    END IF ;
    
    IF(p_tx_type = 'bkash') 
    THEN 
	SELECT  dec_bkash
	INTO 	@current_balance   
	FROM    userbalance 
	WHERE   id = p_id_user_id ;
    END IF ;
  
      IF(p_tx_type = 'sms') 
    THEN 
	SELECT  dec_sms
	INTO 	@current_balance   
	FROM    userbalance 
	WHERE   id = p_id_user_id ;
    END IF ;
    
  
    RETURN @current_balance ;
END */$$
DELIMITER ;

/* Function  structure for function  `getBossId` */

/*!50003 DROP FUNCTION IF EXISTS `getBossId` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getBossId`(p_user_id INT,p_level INT ) RETURNS int(11)
BEGIN
  
  if(p_level=1)THEN
  select level1 into @bossId from userlevel where user_id=p_user_id;
  end if;
  
  IF(p_level=2)THEN
  SELECT level2 INTO @bossId FROM userlevel WHERE user_id=p_user_id;
  END IF;
  
  
  IF(p_level=3)THEN
  SELECT level3 INTO @bossId FROM userlevel WHERE user_id=p_user_id;
  END IF;
  
  
  IF(p_level=4)THEN
  SELECT level4 INTO @bossId FROM userlevel WHERE user_id=p_user_id;
  END IF;
  
  
  IF(p_level=5)THEN
  SELECT level5 INTO @bossId FROM userlevel WHERE user_id=p_user_id;
  END IF;
  
  IF(p_level=6)THEN
  SELECT level6 INTO @bossId FROM userlevel WHERE user_id=p_user_id;
  END IF;
  
   
    RETURN @bossId ;
END */$$
DELIMITER ;

/* Procedure structure for procedure `flexiload` */

/*!50003 DROP PROCEDURE IF EXISTS  `flexiload` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `flexiload`(
    IN p_user_id        INT (11)
  , IN p_tx_phone       VARCHAR(100)
  , IN p_int_amount     INT(10)
  , IN p_int_type       INT(10) 
  , IN p_tx_operator	VARCHAR(100)
  , IN p_userlevel      INT (1)
  
  )
BEGIN
SELECT IF(TIMESTAMPDIFF(
MINUTE ,dtt, NOW())<16,1,0) AS tdiff INTO @dublicate_entry FROM flexiload WHERE (tx_phone=''+p_tx_phone AND int_status=0) limit 1;
IF(@dublicate_entry>0) THEN
 SET @msgbody ='duplicate';
 ELSE
 
SET AUTOCOMMIT=0;
SET @done=0;
SET @i=p_userlevel;
		 WHILE p_userlevel<7 DO
			    SELECT getBossId(p_user_id,p_userlevel) INTO @i_bossid;
			    SELECT getBalance(@i_bossid,'flexiload') INTO @i_currentbalance;
			    IF(@i_currentbalance<p_int_amount) THEN
			   SET @msgbody =p_userlevel;
			    SET @done=0;
			    SET p_userlevel=7;
			    ELSE
			    UPDATE userbalance SET dec_flexiload=dec_flexiload-p_int_amount WHERE user_id=@i_bossid ;
			     INSERT INTO statement
				SET 
				 int_for    = @i_bossid
			       , int_by     = p_user_id
			       , int_type   = '2'  	     		  
			       , dec_pb     = @i_currentbalance 		  
			       , dec_ab     = @i_currentbalance-p_int_amount 
			       , dec_amount = p_int_amount
			       , tx_reason  = 'flexiload'
			       , tx_notes   = p_tx_phone
				, dt           = curdate()
				, dtt          = NOW();
				 SET @done=1;
			       
				 END IF;
				 SET p_userlevel=p_userlevel+1;
				
			END WHILE;
			
		   
		    IF(@done=1) THEN
		    
		    INSERT  INTO flexiload 
			SET 
			user_id    = p_user_id
			, tx_phone     = p_tx_phone
			, int_type     = p_int_type
			, int_amount   = p_int_amount
			, int_status   = 0
			, dt           = curdate()
			, tx_operator  = p_tx_operator;
			
			COMMIT;
			SET @msgbody='done';
		   
		   END IF;
		   
		   IF(@done =0) THEN 
		   ROLLBACK;
		   END IF;
		   
		   
   END IF;
   
   SELECT @msgbody;
   
  
   
    
END */$$
DELIMITER ;

/* Procedure structure for procedure `useraudit` */

/*!50003 DROP PROCEDURE IF EXISTS  `useraudit` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `useraudit`(
   IN p_user_id     int(11)
 , IN p_tx_action   char(20) 
 , IN p_tx_msg	    char(100)
 , IN p_tx_ip  	    char(35)
 , IN p_tx_browser	    CHAR(100)
 , IN p_tx_additional  CHAR(200)
)
BEGIN
    if(exists(select id from useraudit where user_id=p_user_id))then
    delete from useraudit where user_id=p_user_id;
    end IF;
    
    insert INTO useraudit 
    SET
         user_id       = p_user_id
       , tx_action     = p_tx_action
       , tx_msg        = p_tx_msg
       , tx_ip	       = p_tx_ip
       , tx_browser    = p_tx_browser
       , tx_additional = p_tx_additional;
		
    
    END */$$
DELIMITER ;

/* Procedure structure for procedure `useronline` */

/*!50003 DROP PROCEDURE IF EXISTS  `useronline` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `useronline`(
   IN p_user_id     	INT(11)
 , IN p_tx_user_token   CHAR(20) 
 , IN p_tx_session_id	CHAR(100)
