    END */$$
DELIMITER ;

/* Procedure structure for procedure `useronline_monitor` */

/*!50003 DROP PROCEDURE IF EXISTS  `useronline_monitor` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `useronline_monitor`(
   IN p_user_id     	INT(11)
 , IN p_t_last_active   INT(14)
 , IN p_minute            INT(6)
)
BEGIN
 IF(EXISTS(SELECT id FROM useraudit WHERE user_id=p_user_id))THEN
    UPDATE useraudit       SET   t_last_active=p_t_last_active  WHERE user_id=p_user_id;
    END IF;
    
    DELETE FROM useraudite WHERE t_last_active<p_t_last_active-p_minute ;    
    
    END */$$
DELIMITER ;

